import React from 'react';
import Card from "./components/Card";
import Data from './data.json';


const heading = "Todo App";
const App = () =>{
    const item = [];
    for(let x = 0; Data.length; x++){
        item.push(<Card title={Data[0].name} desc= {Data[0].desc} />);
    }
    return(
        <div>
            <h1 className="headingStyle">{heading}</h1>
            <Card title={Data[0].name} desc= {Data[0].desc} />
            <Card title={Data[1].name} desc={Data[1].desc} />
            <Card title={Data[2].name} desc={Data[2].desc} />
        </div>
    )
}

export default App;
